import actions from './actions';

const { RESET_PASSWORD, RESET_ERROR } = actions;

const initState = {
  data: null,
  err: null,
};
const ResetPasswordReducer = (state = initState, action) => {
  const { type, data, err } = action;
  console.log(type, data, err);
  switch (type) {
    case RESET_PASSWORD:
      return {
        ...state,
        data,
      };
    case RESET_ERROR:
      return {
        ...state,
        err,
      };

    default:
      return state;
  }
};
export default ResetPasswordReducer;
